package ManishLokesh.Neptune.v2.payment;import java.util.List;public class PaymentResponse {    private Object paymentGateways;    private String title;    private Object paymentMethods;    public PaymentResponse(Object paymentGateways, String title, Object paymentMethods) {        this.paymentGateways = paymentGateways;        this.title = title;        this.paymentMethods = paymentMethods;    }    public Object getPaymentGateways() {        return paymentGateways;    }    public void setPaymentGateways(Object paymentGateways) {        this.paymentGateways = paymentGateways;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public Object getPaymentMethods() {        return paymentMethods;    }    public void setPaymentMethods(Object paymentMethods) {        this.paymentMethods = paymentMethods;    }}